  [],\n\t\"title\": \"Digitized Shorelines from Approximately 1950 1980, and 2003
  for the Coastal Areas of Bering Land Bridge NP (BELA) and Cape Krusenstern NM (CAKR),
  Northwest Alaska\",\n\t\"tracking_summary\": {\n\t\t\"total\": 12,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2013-03-15T10:50:50.245385\",\n\t\"name\": \"digitized-shorelines-from-approximately-1950-1980-and-2003-for-the-coastal-areas-of-bering-land30295\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This file geodatabase contains all the
  feature classes relevant to the Digital Shorelines and Analysis for the Coastal
  Areas of Bering Land Bridge. These shoreline reference features are defined as the
  waterlines and were digitized onscreen from orthorectified aerial photography from
  approximately 1950 and 2003 for the coastal areas of Bering Land Bridge National
  Preserve (BELA), Cape Krusenstern National Monument (CAKR), and nearby portions
  of northwestern Alaska. The aerial photography frames for the 1950s are derived
  from 1:43,000-scale, black and white (grayscale) photographs acquired by the US
  Air Force from 1949 to 1956. The aerial photography frames for 2003 are derived
  from 1:24,000-scale, natural-color photographs acquired for the NPS on July 19,
  2003 and for NOAA on September 14-24, 2003. These images and the companion shoreline
  were completed as part of a study on coastal erosion in collaboration between the
  University of Colorado (Institute of Arctic and Alpine Research) and the National
  Park Service (Arctic Network Inventory and Monitoring Program). The shoreline has
  a total length of approximately 480 km. Shoreline error was calculated using the
  square root of the sum of the squares (SRSS) calculation of the orthorectification
  and digitization errors. Errors for the approximately 1950s shorelines are 2.9 m
  for BELA and 2.2 m for CAKR. Errors for the 2003 shorelines are 1.0 m for BELA and
  1.7 m for CAKR. The shorelines are available as a feature dataset in this file geodatabase.
  The geodatabase has a UTM zone 3 projection and NAD83 datum, with FGDC-compliant
  metadata. Attribute information in the shoreline table includes, frame number, acquisition
  date, comments, and line length. The geodatabase is available through an unrestricted
  public license, and can be obtained online by request (see Distributor contact information
  below). Other data available in this series includes Bluff-Top coastlines and shoreline
  feature classes. Together, the data will be of interest to land managers, scientists,
  and others for observation and analysis of natural features and ecosystems.\",\n\t\"license_title\":
